import React, { Component } from "react";
import rideService from "../services/rideService";

class ShowRides extends Component {
  state = {};

  async componentDidMount() {
    const rides = await rideService.getRides();
    console.log(rides);
  }

  render() {
    return (
      <div className="row">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <div className="card-title">Tue, 27 Sep 2020</div>
              <div className="col-2">
                <h1>Paras Vohra</h1>
                <p>4 Rating</p>
              </div>
              <div className="col-2">London</div>
              <div className="col-2">&#8594;</div>
              <div className="col-2">Toronto</div>
              <div className="col-2">
                <h2>$23</h2>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ShowRides;
